void create_block_text_double(unsigned char *buff, char *str){
	int col_idx;				// column index
	int bit_idx;				// bit index
	int row_idx;				// row index
	int i;
	int pixels_per_row;			//number of pixels per row
	uint32_t str_idx;				// string index
	uint32_t string_len;			// string length
	unsigned char mask; 		// set to 0x80
	unsigned char currentChar;	// current character
	
	pixels_per_row = TEXT_BLK_X_DIM*2;	
	
	i = 0 ;
	while(str[i] != NULL)
		i++;
	
	string_len = i;
	
	//Go over each character to draw it to the buffer
	for (str_idx = 0 ; str_idx < string_len ; str_idx++){
		for (row_idx = 0; row_idx < FONT_HEIGHT*2 ; row_idx++){
			currentChar = font_data[(int)str[str_idx]][(row_idx/2)];
			mask = 0x80;										//0x80: (10000000)b to extract each bit of byte
			for (bit_idx = 0; bit_idx < FONT_WIDTH*2; bit_idx++){	
				/*Calculate the column index*/
				col_idx = FONT_WIDTH*2 * str_idx + bit_idx;	
				
				if ((mask & currentChar) != 0)
					/*row_idx * pixels_per_row + col_idx: is the address of the current pixel in the buffer*/
					buff[row_idx * pixels_per_row + col_idx] = 0x40;  // 1 : this pixel need to be drawn
				else
					buff[row_idx * pixels_per_row + col_idx] = 0;  // 0 : this pixel does not need to be drawn;
				if(bit_idx%2 == 0)
					mask = mask >>1;			// Right shift the mask by 1 bit to check the next bit of the currentChar
			}
		}
	}
	return;
}


















